import { motion } from "framer-motion"
import estyle from "./RectangleFill.module.scss"

function RectangleFill({props}) {

    const barborder = {
        ready: { opacity: 0 },
        start: { opacity: 1, transition: { delay: props.delay, duration : 1 }}
    }

    const barfill = {
        ready: { x: -110 },
        start: { x: 100,
            transition: { 
                duration: props.lineduration, 
                delay: props.linedelay, 
                type:'tween', 
                ease:'easeOut' 
                // x: { delay: 0, duration: .2, type:'tween', ease:'easeInOut' },
                // width: { delay: 0, duration: .2, type:'tween', ease:'easeInOut' }
            }   
        }
    }

    // const startline = {
    //     ready: { y:0, x: -900 },
    //     start: { x: 0, 
    //         transition: { 
    //             duration: props.lineduration, 
    //             delay: props.linedelay, 
    //             type:'tween', 
    //             ease:'easeOut' 
    //         }    
    //     }
    // }

    return (
        <div>
            <svg width="101" height="6" viewBox="0 0 101 6" fill="none" xmlns="http://www.w3.org/2000/svg">

                <defs>
                    <clipPath id="fillmask">
                    <motion.rect 
                        height="10" 
                        width="500"
                        variants={barfill}
                        initial="ready"
                        animate="start"
                    />
                    </clipPath>
                </defs>

                <path clip-path="url(#fillmask)" id="barfill" d="M80.559 0.722412H0.560425V5.72232H80.559V0.722412Z" fill={props.color}/>

                <motion.path
                variants={barborder}
                initial="ready"
                animate="start"
                d="M100.562 0.722412H0.563477V5.72232H100.562V0.722412Z" stroke={props.color} stroke-width="0.32024" stroke-miterlimit="1.5" stroke-linecap="round" stroke-linejoin="round"/>
            </svg>
        </div>
    )
}
export default RectangleFill;
